import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Login = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await authService.login(form);
      console.log("‚úÖ LOGIN RESULT:", res.data);

      const loginData = res.data;

      // ‚úÖ S·ª¨A L·∫†I: Server tr·∫£ v·ªÅ 'jwt-token' thay v√¨ 'token'
      const token = loginData['jwt-token'] || loginData.token;

      if (!token) {
        console.error("‚ùå No token found in response:", loginData);
        throw new Error("No token received from server");
      }

      // ‚úÖ L∆ØU TOKEN
      localStorage.setItem("token", token);
      console.log("üîê Token saved:", token.substring(0, 50) + "...");

      // ‚úÖ X·ª¨ L√ù USER DATA
      let userToStore = {
        email: form.email,
        first_name: "",
        last_name: ""
      };

      // TR∆Ø·ªúNG H·ª¢P 1: C√≥ user info trong response
      if (loginData.user_id || loginData.userId) {
        userToStore.userId = loginData.user_id || loginData.userId;
        userToStore.first_name = loginData.first_name || loginData.firstName || "";
        userToStore.last_name = loginData.last_name || loginData.lastName || "";

        console.log("üíæ Saving user from login response:", userToStore);
      }
      // TR∆Ø·ªúNG H·ª¢P 2: C√≥ user object trong response
      else if (loginData.user) {
        const user = loginData.user;
        userToStore.userId = user.user_id || user.userId;
        userToStore.first_name = user.first_name || user.firstName || "";
        userToStore.last_name = user.last_name || user.lastName || "";

        console.log("üíæ Saving user from user object:", userToStore);
      }
      // TR∆Ø·ªúNG H·ª¢P 3: Kh√¥ng c√≥ user info - t·∫°o t·∫°m th·ªùi
      else {
        console.warn("‚ö†Ô∏è No user info in login response, creating temporary user");
        userToStore.userId = `temp_${Date.now()}`;

        // Th·ª≠ l·∫•y user info b·∫±ng API kh√°c n·∫øu c√≥ th·ªÉ
        try {
          // G·ªçi API ƒë·ªÉ l·∫•y user info b·∫±ng token
          const userInfoResponse = await fetch('http://localhost:8080/api/auth/me', {
            headers: {
              'Authorization': `Bearer ${token}`
            }
          });

          if (userInfoResponse.ok) {
            const userInfo = await userInfoResponse.json();
            userToStore.userId = userInfo.user_id || userInfo.userId;
            userToStore.first_name = userInfo.first_name || userInfo.firstName || "";
            userToStore.last_name = userInfo.last_name || userInfo.lastName || "";
            console.log("‚úÖ Got user info from /auth/me:", userToStore);
          }
        } catch (userError) {
          console.warn("‚ö†Ô∏è Could not get user info from /auth/me:", userError);
        }
      }

      // ‚úÖ L∆ØU USER DATA
      localStorage.setItem("user", JSON.stringify(userToStore));
      console.log("üë§ User data saved:", userToStore);

      // ‚úÖ KI·ªÇM TRA L·∫†I TR∆Ø·ªöC KHI CHUY·ªÇN TRANG
      const savedToken = localStorage.getItem("token");
      const savedUser = localStorage.getItem("user");

      console.log("üîç FINAL CHECK - Storage:", {
        token: savedToken ? `EXISTS (${savedToken.length} chars)` : "MISSING",
        user: savedUser ? JSON.parse(savedUser) : "MISSING",
        userId: savedUser ? JSON.parse(savedUser).userId : "NO ID"
      });

      if (!savedToken) {
        throw new Error("Token was not saved properly");
      }

      alert("‚úÖ ƒêƒÉng nh·∫≠p th√†nh c√¥ng!");

      // ‚úÖ CHUY·ªÇN TRANG
      setTimeout(() => {
        window.location.href = "/"; // Reload ƒë·ªÉ c·∫≠p nh·∫≠t Header
      }, 500);

    } catch (err) {
      console.error("‚ùå LOGIN ERROR:", err);

      // X√≥a d·ªØ li·ªáu l·ªói
      localStorage.removeItem("token");
      localStorage.removeItem("user");

      alert("‚ùå ƒêƒÉng nh·∫≠p th·∫•t b·∫°i! " + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="card mx-auto" style={{ maxWidth: "380px", marginTop: "100px" }}>
      <div className="card-body">
        <h4 className="card-title mb-4">Sign in</h4>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              name="email"
              className="form-control"
              placeholder="Email"
              type="email"
              value={form.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <input
              name="password"
              className="form-control"
              placeholder="Password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn btn-primary btn-block">
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
